import { Map } from 'immutable'
import { Currency } from '../../src/enums/Currency'

export enum UpgradeType {
  GeneratorMultiplierCashUpgrade,
  GeneratorMultiplierPrestigeUpgrade,
  ManagerUpgrade,
}

interface Upgrade {
  upgradeType: UpgradeType;
  price: number;
  priceCurrency: Currency;
  title?: string;
}

export const getUpgradeId = (upgrade: Upgrade): string => {
  return JSON.stringify({
    upgradeType: upgrade.upgradeType,
    price: upgrade.price,
    priceCurrency: upgrade.priceCurrency,
  })
}

export interface GeneratorMultiplierUpgrade extends Upgrade {
  generatorId: string;
  multiplier: number;
}

// TODO: Implement
export interface GeneratorCountUpgrade extends Upgrade {
  generatorId: string;
  count: number;
}

// TODO: Implement Managers
export interface GeneratorCostModifier extends Upgrade {
  generatorId: string;
  costModifier: number;
}

// TODO: Implement
export interface PrestigeUpgrade extends Upgrade {
  effectiveness: number;
}

export interface ManagerUpgrade extends Upgrade {
  generatorId: string;
}

